  (13,000,000.00 + 12,385,382.42) / 2 = 12,692,691.21

Next, we take the net profit from the income statement which is –1,352,379.63.

Return on Assets (ROA) is then calculated as:

  ROA = (Net Profit / Average Total Assets) × 100
    = (–1,352,379.63 / 12,692,691.21) × 100 ≈ –10.65%

